import React, { Component } from 'react';

class Login extends Component {
    constructor(props) {
        super(props);
        this.login = this.login.bind(this);
    }

    async login() {
        this.props.authService.login('/profile');
    }

    render() {
        return(null)

    }
};

export default withOktaAuth(Login)
